import React from "react";

const UserList = (props) => {
    return ( 
        <div>
                {props.users.map((item) => (
                    <p>
                    <a href="#!" className="" key="id" onClick={props.UpdateCurrentUser.bind(this,item)}>{item.name}</a>
                    </p>
                ))}
        </div>
    );
}

export default UserList;
